import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import header from './header'


function App() {
  return (
    <div>
    <header />



        <Router>
<Route exact path="/" >
  <Home />
</Route>
 <Route path="/about">
  <About />
  </Route>
  <Route path="/contact"> 
    <Contact />
  </Route>
</Router> 
</div>



  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>CONTACT</h2>;
}



export default App;
